import React from 'react';
import '../navbar.css';

function NavBar(){
    return(
        <div>
            <img src='../images/'></img>
            <ul>
                <li><a href='./'>Home</a></li>
                <li><a href='./'>Category</a></li>
                <li><a href='./'>About</a></li>
                <li><a href='./'>Contact</a></li>
            </ul>
            <form>
                <input></input>
            </form>
            <button>Join the community</button>
        </div>
    );
}

export default NavBar;
